【DHC 香るブルガリアンローズ カプセル 20日分の詳細】<br>
●気になる臭いをバラの香りでカバー。天然ダマスクローズを100％使用。<br>
●シトロネロール、ゲラニオールといった香りの成分が含まれるローズオイルを配合。<br>
●最高級といわれる天然ダマスクローズを100％使用したローズオイルを、1日目安量あたり11mg摂ることができます。臭いが気になる方に。<br><br>

【召し上がり方】<br>
水またはぬるま湯で噛まずにそのままお召し上がりください。<br><br>

【ご注意】<br>
○1日の目安量を守って、お召し上がりください。<br>
○お身体に異常を感じた場合は、飲用を中止してください。<br>
○原材料をご確認の上、食物アレルギーのある方はお召し上がりにならないでください。<br>
○薬を服用中あるいは通院中の方、妊娠中の方は、お医者様にご相談の上お召し上がりください。<br>
○健康食品は食品なので、基本的にはいつお召し上がりいただいてもかまいません。食後にお召し上がりいただくと、消化・吸収されやすくなります。他におすすめのタイミングがあるものについては、上記商品詳細にてご案内しています。<br>
○直射日光、高温多湿な場所をさけて保存してください。<br>
○お子様の手の届かないところで保管してください。<br>
○開封後はしっかり開封口を閉め、なるべく早くお召し上がりください。<br><br>

【主要原材料】<br>
オリーブ油、ビタミンE含有植物油/ゼラチン、グリセリン、ローズオイル<br><br>

【栄養成分表示】１日あたり：2粒660mg<br>
熱量4.6kcal、たんぱく質0.19g、脂質0.40g、炭水化物0.05g、食塩相当量0.0004g、ビタミンE（d-α-トコフェロール）10mg、ローズオイル11mg<br><br>

【賞味期限】<br>
