【ファンケル 50代からのサプリメント 女性用の詳細】<br>
●年代別・性別に最適なサプリメントをワンパックにいたしました。<br>
●HTCコラーゲン＆大豆サポニン＆ヒアルロン酸：日常の紫外線ダメージから美しさを守り内側からみずみずしくうるおう。<br>
●カルシウム＆マグネシウム：現代人に不足しがちな栄養素を補えます。<br>
●ブルーベリー＆ルテイン＆アスタキサンチン：使いすぎから生じる疲れや毎日の見るチカラを応援。<br>
●ナットウキナーゼ＆DHA：澄んだめぐりにアプローチ。<br>
●いちょう葉：10種類のフラボノイドを含み、体のすみずみまで健康に保つ。<br>
●還元型コエンザイムQ10：エネルギーやサビにアプローチし、若々しさに役立つ。<br>
●ビタミンB&C：体内にストックできない基本のビタミン。<br><br>

【1日の目安】<br>
1-2袋<br><br>

【ご注意】<br>
○本品は、原材料の一部に卵・乳・大豆・ゼラチンが含まれています。食品アレルギーのある方はお召し上がりにならないでください。<br>
○妊娠・授乳中の方、お子様はお召し上がりにならないでください。<br>
○本品により、尿が黄色くなることがありますが、これはビタミンB2による一時的なものですので心配はいりません。<br><br>

【主要成分】1袋当たり<br>
ビタミンD：0.42μg、ビタミンE：3.5mg、ビタミンK：5μg、ビタミンB1：8.3mg、ビタミンB2：4mg、ナイアシン：5mg、ビタミンB6：4.1mg、葉酸：177μg、ビタミンB12：21μg、ビオチン：167μg、パントテン酸：10mg、ビタミンC：346mg、カルシウム：58mg、マグネシウム：29mg、ビタミンP（ヘスペリジン）：3.8mg、イノシトール：17mg、還元型コエンザイムQ10：15mg、いちょう葉エキス：60mg（フラボノイド:24％、テルペンラクトン：6％）、納豆菌培養エキス末：25mg（ナットウキナーゼ：500FU）、トコトリエノール：6mg、DHA：41mg、ルテイン：5mg、アスタキサンチン（フリー体として）：2mg、シアニジン-3-グルコシド:1.2mg、植物性ツイントース：83mg、大豆イソフラボンアグリコンとして：2.625mg（総イソフラボン：2.7mg）、活性大豆サポニンB型：6.3mg、コエンザイムQ10：7.5mg、HTCコラーゲン：113mg（トリペプチド高含有コラーゲンペプチド）、ヒアルロン酸：1.3mg<br>
※シアニジン-3-グルコシドは、ブルーベリー（ビルベリー）エキス10mg、黒大豆種皮エキス13.3mgに含まれます。<br><br>

