【スベルティ ぱっくん分解酵母の詳細】<br>
●「糖質を食べる酵母」 新発想タイムカプセル製法！食べ物と温度で目覚める酵母菌。<br>
●炭水化物が大好きな「酵母菌」や、ダイエット大国アメリカで10年以上の歴史を持つ「キトサン」をはじめ、長年愛されてきた6種類のハーブを1粒にギュッと詰め込みました。あなたの食生活をサポートします。<br><br>

【使用方法】<br>
食品として、1日2-4粒を目安に水またはぬるま湯でお召し上がりください。<br><br>

【ご注意】<br>
○原材料をご参照のうえ、アレルギーがある方、妊娠中の方、授乳中の方、疾病治療中の方の摂取はご配慮ください。<br>
○まれに体質に合わない場合もございます。お召し上がり前に表示及び説明文をよくお読みのうえ、正しくお召し上がりください。<br>
○お召し上がり後、体調のすぐれない場合はお召し上がりを中止してください。<br>
○植物由来の原料を使用しておりますので、色調等にばらつきがある場合がありますが、品質に問題はありませんので、安心してお召し上がりください。<br><br>

【原材料】<br>
乾燥酵母、キトサン(えびを含む)、白いんげん豆エキス末、難消化性デキストリン、乳糖、ガルシニアカンボジアエキス末、キャンドルブッシュ末、ギムネマシルベスタエキス末、サラシアレティキュラータエキス末、抹茶、オリゴ糖、ウーロン茶エキス末、デキストリン、ビフィズス菌、マルトデキストリン/結晶セルロース、ゼラチン、ステアリン酸カルシウム、二酸化ケイ素、コハク酸、炭酸カルシウム<br><br>

【栄養成分表示】2粒中(0.626g)あたり<br>
エネルギー：1.9kcal、たんぱく質：0.25g、脂質：0.037g、炭水化物：0.27g(糖質：0.02g、食物繊維：0.25g)、食塩相当量：0.001g<br><br>

【保存方法】<br>
高温多湿及び直射日光をさけて冷暗所に保存ください。<br><br>

【賞味期限】<br>
パッケージに記載<br><br>

【内容量】<br>
56粒<br><br>

